import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  appBar: {
    borderRadius: 15,
    margin: '30px 0',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },
  heading: {
    color: '#333',
    margin:'5%'
  },
  image: {
    marginLeft: '15px',
  },
  createFab:{
    // display:'flex',
    // flexWrap:'wrap-reverse',
    // flexDirection:'row-reverse',
    // justifyContent:'flex-end',
    // position:'fixed',

    position: 'fixed',
    width: '100%',
    height: '100%',
    display: 'flex',
    flexWrap: 'wrap-reverse',
    flexDirection: 'row-reverse'
   },
   fabIcon:{
    width:'130px',
    height:'130px',
    position: 'absolute'
   }

}));
